ads.description:
MUTARE IMEDIATA!

POZE REALE DIN LOCATIE!



Garsoniera Noua Decomandata , dispune de bucatarie inchisa si este mobilata si utilata modern.



Imobilul are ca dotari si facilitatati urmatoarele:



* Complexul este din anul 2018 si dispune de locuri de parcare private , curte spatioasa privata si securizata cu bariera cu supraveghere video;

* Imobilul este decomandat si dispune de pat matrimonial, mini biblioteca , dulap o masa si 2 scaune;

* Electrocasnice Noi ;

* Cheltuieli de intretinere minime;

* Locatia accesibila pt studentii din Tudor Vladimirescu;

* Statia mijloacelor de transport in comun la 100 de metri de complex.




Vasile Ciprian 0728781131.Va rog sa ma contactati telefonic,pentru mai multe detalii.

    Va propunem spre inchiere un apartament de 3 camere decomandat si foarte spatios, de 150mp, situat in Targu Cucu. Imobilul este complet mobilat si utilat lux si gata de mutare imediata.

    Apartamentul este compus din: hol larg, bucatarie patrata cu balcon si camera tehnica, 2 dormitoare spatioase(unul cu balcon), living foarte generos dotat cu balcon si 2 bai moderne.  



    Principalele specificatii: 


etaj intermediar, 4/8;
lift modern;
aer conditionat;
centrala termica proprie;
electrocasnice de ultima generatie, dotare completa(TV, frigider, masina de spalat, cuptor cu microunde);
bai echipate complet, cada cu hidromasaj;
finisaje si decoratiuni moderne si cu un design placut vederii;
toate utilitatile.

    Pentru mai multe detalii va invitam sa contactati consilierul imobiliar Alexandru Machidon la numarul de telefon 0749960860.

    Va invitam la vizionare!
